const ethUtil = require('ethereumjs-util');
// ContractDeployerFactory的地址:
const deployContract = '0b7b30f4d1d6c148e4336dec1d08cb202a46c05a';
// 待部署合约的bytecode:
const bytecode = '__$f667e4af5ad9998b66d0608ce38350f43d$____$f667e4af5ad9998b66d0608ce38350f43d$____$f667e4af5ad9998b66d0608ce38350f43d$____$f667e4af5ad9998b66d0608ce38350f43d$__63bc2b405c909184846040518463ffffffff1660e01b815260040161187d93929190613225565b5f6040518083038186803b158015611893575f80fd5b505af41580156118a5573d5f803e3d5ffd5b50505050611921565b6118b8825f6121a9565b600a73__$f667e4af5ad9998b66d0608ce38350f43d$____$f667e4af5ad9998b66d0608ce38350f43d$__...';
// 待部署合约构造方法参数:
const constructorArgs = '';

// 计算bytecode的哈希:
let bytecodeHash = ethUtil.keccak256(new Buffer(bytecode + constructorArgs, 'hex')).toString('hex');

// 寻找特定的salt:
for (let i = 0; i < 0xfffffff; i++) {
    let salt = i.toString(16).padStart(64, '0');
    // 用deployContract, salt和bytecodeHash计算payload:
    let payload = 'ff' + deployContract + salt + bytecodeHash;
    // 计算合约地址:
    let addr = ethUtil.bufferToHex(ethUtil.keccak256(new Buffer(payload, 'hex'))).substr(26);
    // 如果以指定前缀开头则找到特定的salt:
    if (addr.endsWith('ffff')) {
        console.log("salt", salt);
        console.log("addr", "0x" + addr);
        break;
    }
}
console.log('END');